Tangi äpi kasutamine on imelihtne:
-Registreeri end kasutajaks;
-Tuvasta tankla asukoht;
-Lisa sobiv sooduskaart ja maksekaart;
-Alusta tankimist ning tasu mobiilimaksega.

Korralda oma rahaasju seal, kus parasjagu viibid. Coop Panga mobiilipanga kasutamine on tõeliselt mugav ja lihtne nii era- kui ka ärikliendile.

Mobiilipangas saad:
•	liituda kiirelt ja mugavalt Coop Pangaga;
•	vaadata kiirelt kontojääki ja kontrollida tehinguid;
•	hallata mugavalt oma pangakaarte ja Säästukaart Plussi;
•	vaadata kogunenud Coopi boonusraha;
•	jagada lihtsalt kontonumbrit ja maksekorraldusi;
•	salvestada makseid;
•	teha telefoninumbri alusel mugavalt makseid sõpradele;
•	kinnitada ettevalmistatud makseid;
•	kinnitada ilma PIN-koodita alla 30-euroseid makseid;
•	hoida silma peal e-arvetel ja automaatsetel püsikorraldustel;
•	teavitusi laekumiste ja väljaminekute kohta.


Manage your finances wherever you go. Using the Mobile Bank of Coop Pank is really convenient and simple for both private and business clients.

In our Mobile Bank you can:
•	become a Coop Pank client quickly and conveniently;
•	get a quick overview of your balance and check transactions;
•	conveniently manage your bank cards and Säästukaart Pluss;
•	view your Coop bonus balance;
•	easily share your account number and payment orders;
•	save payments;
•	make swift payments to friends using their telephone number;
•	authorize payments prepared beforehand;
•	authorize payments under 30 euros without entering your PIN;
•	monitor your e-invoices and standing orders; and
•	get notifications about accruals and expenses.

Privat24 is one mobile banking app for everyone.

It does not matter whether you are an individual or an entrepreneur, whether you have a card of PrivatBank or another bank. Necessary services are available for everyone.

Pay for anything and anywhere:
• transfers to Visa and Mastercard cards;
• top-ups of mobile numbers of all Ukrainian carriers;
• payment for utilities, Internet, television, education, payment of fines for traffic rules violation, etc.;
• currency exchange;
• instant transfers and SWIFT transfers.

Loans and savings control:
• credit limit management;
• repayment under the "Payment by parts" and "Instant installment" agreements;
• cash loan, mortgage, and car leasing;
• accumulation of funds using the "Moneybox" service.

Unique services:
• purchase of train tickets;
• payment of fares on public transport;
• registration of insurance policies – health insurance, travel insurance, MTPL insurance;
• adding discount cards to accumulate bonuses.

Lots of card and account management features:
• limit management – for online payment and cash withdrawal;
• cash withdrawal and cash order;
• issuing and reissuing card online;
• adding card to Apple Pay;
• choice of virtual card design.

Features available for entrepreneurs:
• transfer of funds from the entrepreneur's account;
• view of balance and account statement;
• sharing account details with business partners.

We could describe all the benefits of the updated Privat24 application for a long time. But better see for yourself.

Join us. More than 13 million clients already did it.

